import React from 'react';
import {FirstName} from './App';

const CompC = () => {
    return (
        <>
            <FirstName.Consumer>
                {(fName) => {
                    return <h1>Hello I am {fName}</h1>;
                }}
            </FirstName.Consumer>

        </>
    );
}

export default CompC;
